def check_board(board, global_board, fill_num, prev):
    """Sum the probability of winning over the global board based on the lines"""
    prev_i, prev_j = prev if prev is not None else (-1, -1)
    lines = [
        # rows
        ((0, 0), (0, 1), (0, 2)),
        ((1, 0), (1, 1), (1, 2)),
        ((2, 0), (2, 1), (2, 2)),
        # cols
        ((0, 0), (1, 0), (2, 0)),
        ((0, 1), (1, 1), (2, 1)),
        ((0, 2), (1, 2), (2, 2)),
        # diags
        ((0, 0), (1, 1), (2, 2)),
        ((0, 2), (1, 1), (2, 0)),
    ]

    local_mem = {}
    prob = []  # rows cols diags
    for line in lines:
        prob_line = 1
        p1_win = p2_win = drawn = 0

        for i, j in line:
            stat = global_board[i, j]
            if (i, j) in local_mem:
                prob_line *= local_mem[(i, j)]
            elif stat == 0:
                # in play check the look up table board is the whole 3x3x3x3 board
                # Flatten the 3x3 board and join its elements into a string key
                if prev_i != i or prev_j != j:
                    k1 = "1" + "".join(
                        str(board[i, j, r, c]) for r in range(3) for c in range(3)
                    )
                    prob1 = LOCAL_SCORE[k1] + np.finfo(float).eps
                    k2 = "2" + "".join(
                        str(board[i, j, r, c]) for r in range(3) for c in range(3)
                    )
                    prob2 = LOCAL_SCORE[k2] + np.finfo(float).eps
                    stored_prob = (prob1 + prob2) / 2
                else:
                    key = f"{fill_num}" + "".join(
                        str(board[i, j, r, c]) for r in range(3) for c in range(3)
                    )
                    stored_prob = LOCAL_SCORE[key] + np.finfo(float).eps

                local_mem[(i, j)] = stored_prob
                prob_line *= stored_prob
            elif stat == 3:
                # once drawn no one can win so return a neutral number
                drawn += 1
                break
            elif stat == 1:
                p1_win += 1
            elif stat == 2:
                p2_win += 1

        if drawn != 0 or (p1_win > 0 and p2_win > 0):  # check that each won one the line is drawn
            prob_line = 0.5
        elif p1_win > 0 and p2_win == 0:
            if prob_line < 0.5:
                prob_line += 0.5
        elif p2_win > 0 and p1_win == 0:
            if prob_line > 0.5:
                prob_line -= 0.5
        prob.append(prob_line)

    return prob


class StudentAgent:
    WEIGHTS = np.array(
        [
            [2, 1, 2],
            [1, 4, 1],
            [2, 1, 2],
        ]
    )

    def __init__(self, depth: int = 4, is_max=True):
        """Instantiates your agent."""
        self.max_depth = depth
        self.is_max = is_max
        self.turn = 0

    def choose_action(self, state: State) -> Action:
        """Returns a valid action to be played on the board.
        Assuming that you are filling in the board with number 1.

        Parameters
        ---------------
        state: The board to make a move on.
        """
        if not self.is_max:
            state = state.invert()

        _, move = self._minimax(
            alpha=-np.inf,
            beta=np.inf,
            depth=self.max_depth,
            state=state,
            is_max=True,
        )

        if self.turn < 10:
            print(f"{self.turn} generated move: ", move)
            if state.prev_local_action is not None and state.prev_local_action in set(((0, 1), (1, 0), (1, 2), (2, 1))):
                row, col = state.prev_local_action
                move = (row, col, (row + 1) % 2, (col + 1) % 2)
            print(f"{self.turn} new move: ", move)
            self.turn += 2

        return move

    def _minimax(self, alpha, beta, depth, state: State, is_max):
        if state.is_terminal():
            score = state.terminal_utility()

            if score == 1:  # we win
                return 9999999, None
            if score == 2:  # they win
                return -9999999, None
            return 0, None  # no win

        if depth <= 0:
            return self._heuristic(state), None

        moves = state.get_all_valid_actions()

        move = moves[0]

        if is_max:
            next_state = state.change_state(move)
            value, _ = self._minimax(alpha, beta, depth - 1, next_state, False)
            alpha = max(alpha, value)

            for action in moves[1:]:
                if alpha >= beta:
                    break

                new_state = state.change_state(action)
                tmp_v, _ = self._minimax(alpha, beta, depth - 1, new_state, False)

                if tmp_v > value:
                    value = tmp_v
                    move = action

                alpha = max(alpha, value)
        else:
            next_state = state.change_state(move)
            value, _ = self._minimax(alpha, beta, depth - 1, next_state, True)
            beta = min(beta, value)

            for action in moves[1:]:
                if alpha >= beta:
                    break

                new_state = state.change_state(action)
                tmp_v, _ = self._minimax(alpha, beta, depth - 1, new_state, True)

                if tmp_v < value:
                    value = tmp_v
                    move = action

                beta = min(beta, value)

        return value, move

    def _prep_feat(self, state: State) -> np.ndarray:
        global_stat = state.local_board_status
        board = state.board

        board_prob = np.array(check_board(board, global_stat, state.fill_num, state.prev_local_action))
        board_prob = (board_prob * 2) - 1  # convert to [-1, 1] range
        # og = board_prob.copy()
        # based on the prev local action we place more emphasis on rows/ cols/ diags which conincide
        # with it

        if state.prev_local_action is not None:
            curr_row, curr_col = state.prev_local_action
            # place more weight on the curr_row/ curr_col and the diag if it falls on the diag

            # board_prob[curr_row] = board_prob[curr_row] * 1.5
            # board_prob[3 + curr_col] = board_prob[curr_col] * 1.5

            if (board_prob[curr_row] > 0 and state.fill_num == 1) or (
                board_prob[curr_row] < 0 and state.fill_num == 2
            ): # reward our winning positions in our turn
                board_prob[curr_row] *= 1.2
            elif (board_prob[curr_row] < 0 and state.fill_num == 1) or (
                board_prob[curr_row] > 0 and state.fill_num == 2
            ): # penalise the other player if its their winning position but our turn
                board_prob[curr_row] *= 0.5

            if (board_prob[3 + curr_col] > 0 and state.fill_num == 1) or (
                board_prob[3 + curr_col] < 0 and state.fill_num == 2
            ): # reward our winning positions in our turn
                board_prob[3 + curr_col] *= 1.2
            elif (board_prob[3 + curr_col] < 0 and state.fill_num == 1) or (
                board_prob[3 + curr_col] > 0 and state.fill_num == 2
            ): # penalise the other player if its their winning position but our turn
                board_prob[3 + curr_col] *= 0.5

            if curr_row == curr_col == 0 or curr_row == curr_col == 2:
                # top left to btm right diag ie 2nd last entry
                # board_prob[6] = board_prob[6] * 1.2
                if (board_prob[6] > 0 and state.fill_num == 1) or (
                    board_prob[6] < 0 and state.fill_num == 2
                ):
                    board_prob[6] *= 1.2
                elif (board_prob[6] < 0 and state.fill_num == 1) or (
                    board_prob[6] > 0 and state.fill_num == 2
                ):
                    board_prob[6] *= 0.5
            elif curr_row == 1 and curr_col == 1:
                # both diag
                # board_prob[6] = board_prob[6] * 1.2
                # board_prob[7] = board_prob[7] * 1.2
                if (board_prob[6] > 0 and state.fill_num == 1) or (
                    board_prob[6] < 0 and state.fill_num == 2
                ):
                    board_prob[6] *= 1.2
                elif (board_prob[6] < 0 and state.fill_num == 1) or (
                    board_prob[6] > 0 and state.fill_num == 2
                ):
                    board_prob[6] *= 0.5

                if (board_prob[7] > 0 and state.fill_num == 1) or (
                    board_prob[7] < 0 and state.fill_num == 2
                ):
                    board_prob[7] *= 1.2
                elif (board_prob[7] < 0 and state.fill_num == 1) or (
                    board_prob[7] > 0 and state.fill_num == 2
                ):
                    board_prob[7] *= 0.5
            elif curr_row == 0 and curr_col == 2 or curr_row == 2 and curr_col == 0:
                # top right to btm left diag ie 7th entry
                # board_prob[7] = board_prob[7] * 1.2
                if (board_prob[7] > 0 and state.fill_num == 1) or (
                    board_prob[7] < 0 and state.fill_num == 2
                ):
                    board_prob[7] *= 1.2
                elif (board_prob[7] < 0 and state.fill_num == 1) or (
                    board_prob[7] > 0 and state.fill_num == 2
                ):
                    board_prob[7] *= 0.5
        else:
            # we add more weight to the max and min prob
            max_prob = np.max(board_prob)
            min_prob = np.min(board_prob)
            max_indices = board_prob == max_prob
            min_indices = board_prob == min_prob

            # board_prob[max_indices] = board_prob[max_indices] * 1.2
            # board_prob[min_indices] = board_prob[min_indices] * 1.2

            max_mask = max_indices & (board_prob > 0)
            min_mask = min_indices & (board_prob < 0)

            if state.fill_num == 1:
                board_prob[max_mask] *= 1.2
                board_prob[min_mask] *= 0.5
            elif state.fill_num == 2:
                board_prob[min_mask] *= 1.2
                board_prob[max_mask] *= 0.5

        nz_cnt = np.count_nonzero(board_prob)
        if nz_cnt == 1:
            board_prob *= 1.8

        # may or may not include these
        feat = [sum(board_prob) / 8]  # 8 possible winning lines
        if state.prev_local_action is None:
            feat.append(1 if state.fill_num == 1 else -1)
        elif global_stat[state.prev_local_action] != 0:
            feat.append(1 if state.fill_num == 1 else -1)
        else:
            feat.append(0)
        feat.append(1 if board[1, 1, 1, 1] == 1 else (-1 if board[1, 1, 1, 1] == 2 else 0))

        # return np.array(feat)
        return board_prob

    def _heuristic(self, state: State) -> int:
        # weights = np.array([5, 10, 1.5, 7, 2, 2, 1.2, 2])
        # use sigmoid function to clip the values, -1 to preserve sign
        def _sigmoid(x):
            return 2 / (1 + np.exp(-x)) - 1

        feat = self._prep_feat(state)
        # return weights @ feat
        return _sigmoid(sum(feat))


